script: |
  super -f text -I q1664.spq | sort > q1664.out

inputs:
  - name: q1664.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE - 16 * - col1 NOT BETWEEN 11 * - + col2 AND 29 + col0 * + CAST ( + col0 AS INTEGER );
  - name: tab2

outputs:
  - name: q1664.out
    data: |
